import './App.css';
import Navc from "./component/Navc";
import Login from "./component/Login";
import Register from "./component/Register";
import Slider from "./component/Slider";
import Carde from "./component/Card";
import Secnav from "./component/Secnav";

function App() {
  return (
  <>

   <Navc/>
   <Secnav/>
   <Slider/>
   <br/>
   <h1 className=" container text-center">Trending Products</h1>
    <Carde imgsrc="https://m.media-amazon.com/images/I/71jG+e7roXL._AC_UL480_QL65_.jpg" title="Apple Mac Book Pro" description="this is new apple product" path="/laptop"/>
    </>
  )  
}

export default App;
